import Registration from "./Registration";
import { Routes, Route } from "react-router-dom";
import B from './components/Bill'

const App = () => {
  return(
      <Routes>
         <Route path="/" element={<Registration />} />
         <Route path="/form" element={<Bill />} />
      </Routes>
  )
};

export default App;
